  body_html: <?xml version="1.0" encoding="utf-8"?> <!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Transitional//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd"> <html xmlns="http://www.w3.org/1999/xhtml" lang="en" xml:lang="en"> <head> 	<title>Untitled document</title> 	<meta http-equiv="Content-Type" content="text/html; charset=utf-8" /> </head> <body>  BAL was micro-centrifuged (2,700 rpm for 5 min), the supernatant removed (for other analysis parameters) and 0.5ml PBS added to the cell pellet.&nbsp; The cell suspension was centrifuged again, the supernatant discarded and 0.1ml PBS added.&nbsp; 10ul of this cell suspension was then taken for wet cell counts. Following the wet counts cytospins were prepared for differential cell counts.<br />Mucin content was quantified using the UEA-1 Enzyme Linked Lectin Assay (ELLA). Protease activity was measured using a Molecular Probes Fluorescence &lsquo;EnzChek&rsquo; Protease Assay kit. <br />70?l of BAL was sent to Charles River for Luminex multi-analyte profiling (MAP) by Rules Based Medicine (RBM, Texas, USA).   </body> </html>
