project_contents_045: 
  name: ProjectContent-61
  updated_at: 2007-04-30 16:01:42
  body_html: "<?xml version=\"1.0\" encoding=\"utf-8\"?> <!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\" \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\"> <html xmlns=\"http://www.w3.org/1999/xhtml\" lang=\"en\" xml:lang=\"en\"> <head> \t<title>Untitled document</title> \t<meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\" /> </head> <body> <p><strong>High-throughput screening (HTS)</strong>, is a method for scientific <a href=\"http://en.wikipedia.org/wiki/Experiment\" title=\"Experiment\">experimentation</a> especially used in drug discovery and relevant to the fields of <a href=\"http://en.wikipedia.org/wiki/Biology\" title=\"Biology\">biology</a> and <a href=\"http://en.wikipedia.org/wiki/Chemistry\" title=\"Chemistry\">chemistry</a>.</p>   //<![CDATA[  if (window.showTocToggle) { var tocShowText = \"show\"; var tocHideText = \"hide\"; showTocToggle(); }  //]]>  <p><a id=\"Purpose_and_method\" name=\"Purpose_and_method\"></a></p> <h2><span class=\"mw-headline\">Purpose and method</span></h2> <p>Through a combination of modern <a href=\"http://en.wikipedia.org/wiki/Robotics\" title=\"Robotics\">robotics</a>, data processing and control software, liquid handling devices, and sensitive detectors, HTS allows a researcher to effectively conduct millions of biochemical, genetic or pharmacological tests in a short period of time. Through this process one can rapidly identify active compounds, antibodies or genes which modulate a particular biomolecular pathway. The results of these experiments provide starting points for drug design and for understanding the interaction or role of a particular biochemical process in biology.</p> <p>In essence, HTS uses a <a href=\"http://en.wikipedia.org/wiki/Brute_force\" title=\"Brute force\">brute-force</a> approach to collect a large amount of experimental data -- usually observations about how some biological entity reacts to exposure to various chemical compounds -- in a relatively short time. A <em>screen</em>, in this context, is the larger experiment, with a single goal (usually testing a <a href=\"http://en.wikipedia.org/wiki/Scientific_hypothesis\" title=\"Scientific hypothesis\">scientific hypothesis</a>), to which all this data may subsequently be applied.</p> <p>A key piece of HTS equipment is a <em>plate</em>: a small container, usually made of plastic, that features a grid of small, open divots called <em>wells</em>. Most of the wells contain experimentally useful matter, often a <a href=\"http://en.wikipedia.org/wiki/Solution\" title=\"Solution\">solution</a> of <a href=\"http://en.wikipedia.org/wiki/Dimethyl_sulfoxide\" title=\"Dimethyl sulfoxide\">dimethyl sulfoxide</a> (DMSO) and some other <a href=\"http://en.wikipedia.org/wiki/Chemical_compound\" title=\"Chemical compound\">chemical compound</a>, the latter of which is different for each well across the plate. (The other wells are empty, intended for use as optional experimental <a href=\"http://en.wikipedia.org/wiki/Control\" title=\"Control\">controls</a>.)</p> <p>To prepare for an assay, the researcher fills each well of the plate with some biological entity that he or she wishes to conduct the experiment upon, such as a <a href=\"http://en.wikipedia.org/wiki/Protein\" title=\"Protein\">protein</a>, some <a href=\"http://en.wikipedia.org/wiki/Cell_%28biology%29\" title=\"Cell (biology)\">cells</a>, or an animal <a href=\"http://en.wikipedia.org/wiki/Embryo\" title=\"Embryo\">embryo</a>. After some <a href=\"http://en.wikipedia.org/wiki/Incubation\" title=\"Incubation\">incubation</a> time has passed to allow the biological matter to absorb, bind to, or otherwise react (or fail to react) with the compounds in the wells, measurements are taken across all the plate&#39;s wells, either manually or by a machine. Manual measurements are often necessary when the researcher is using <a href=\"http://en.wikipedia.org/wiki/Microscopy\" title=\"Microscopy\">microscopy</a> to (for example) seek changes or defects in embryonic development caused by the wells&#39; compounds, looking for effects that a computer could not easily determine by itself. Otherwise, a specialized automated analysis machine can run a number of experiments on the wells (such as shining polarized light on them and measuring reflectivity, which can be an indication of protein binding). In this case, the machine outputs the result of each experiment as a grid of numeric values, with each number mapping to the value obtained from a single well. A high-capacity analysis machine can measure dozens of plates in the space of a few minutes like this, generating thousands of experimental datapoints very quickly.</p> <p>Depending upon the results of this first assay, the researcher can perform follow up assays within the same screen by &quot;cherrypicking&quot; liquid from the wells that gave interesting results (known as &quot;hits&quot;) into new assay plates, and then re-running the experiment to collect further data on this narrowed set, confirming and refining observations.</p> <p>A screening facility typically holds a library of <em>stock plates</em>, whose contents are carefully catalogued, and each of which may have been created by the lab or obtained from a commercial source. These stock plates themselves are not directly used in experiments; instead, separate <em>assay plates</em> are created as needed. An assay plate is simply a copy of a stock plate, created by <a href=\"http://en.wikipedia.org/wiki/Pipette\" title=\"Pipette\">pipetteing</a> a small amount of liquid (often measured in <a href=\"http://en.wikipedia.org/wiki/Nanoliter\" title=\"Nanoliter\">nanoliters</a>) from the wells of a stock plate to the corresponding wells of a completely empty plate.</p> <p><a href=\"http://en.wikipedia.org/wiki/Automation\" title=\"Automation\">Automation</a> is an important element in HTS&#39;s usefulness. A specialized <a href=\"http://en.wikipedia.org/wiki/Robot\" title=\"Robot\">robot</a> is often responsible for much of the process over the lifetime of a single assay plate, from creation through final analysis. An HTS robot can usually prepare and analyze many plates simultaneously, further speeding the data-collection process. HTS robots currently exist which can test up to 100,000 compounds per day (Hann 2004).</p> <p>HTS is a relatively recent innovation, made lately feasible through modern advances in robotics and high-speed computer technology. It still takes a highly specialized and expensive screening lab to run an HTS operation, however, so in many cases a small-to-moderately sized research institution will use the services of an existing HTS facility rather than set up one for itself.</p> <p>There is a trend in academia to be their own drug discovery enterprise. Facilities which normally only industry had can now increasingly be found as well at universities. UCLA for example features an HTS laboratory (<a rel=\"nofollow\" href=\"http://mssr.pharmacology.ucla.edu/\" title=\"http://mssr.pharmacology.ucla.edu\" class=\"external text\">Molecular Screening Shared Resources</a> (MSSR, UCLA)) which screens up to 100,000 compounds a day on a routine basis.</p> </body> </html>"
