project_contents_034: 
  name: ProjectContent-50
  updated_at: 2007-04-30 14:10:39
  body_html: "<?xml version=\"1.0\" encoding=\"utf-8\"?> <!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\" \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\"> <html xmlns=\"http://www.w3.org/1999/xhtml\" lang=\"en\" xml:lang=\"en\"> <head> \t<title>Untitled document</title> \t<meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\" /> </head> <body> <p>Revivogen is a non-FDA approved topical DHT inhibitor treatment applied to the scalp, with many ingredients, such as certain <a href=\"http://en.wikipedia.org/wiki/Fatty_acid\" title=\"Fatty acid\">fatty acids</a>, that are thought, though not proven, to inhibit DHT levels in the scalp and have a positive influence in combating hair loss. Revivogen also contains ingredients that are thought, though not proven, to function as an <a href=\"http://en.wikipedia.org/wiki/Antiandrogens\" title=\"Antiandrogens\">antiandrogen</a> (see below) that has a positive influence in combating hair loss. Clinical trials are reportedly underway.<sup class=\"noprint Template-Fact\"><a href=\"http://en.wikipedia.org/wiki/Wikipedia:Citing_sources\" title=\"Wikipedia:Citing sources\"><span style=\"white-space: nowrap\">[<em>citation needed</em>]</span></a></sup></p> <p>Revivogen uses simple mixtures of fatty acids (<a href=\"http://en.wikipedia.org/wiki/Gamma-linolenic_acid\" title=\"Gamma-linolenic acid\">gamma-linolenic acid</a>, <a href=\"http://en.wikipedia.org/wiki/Alpha-linolenic_acid\" title=\"Alpha-linolenic acid\">alpha-linolenic acid</a>, and others, which are thought to be inhibitors of <a href=\"http://en.wikipedia.org/wiki/5-alpha_reductase\" title=\"5-alpha reductase\">5-alpha reductase</a>, both type I and type II <sup class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/Baldness_treatments#_note-liang1\">[3]</a></sup> <sup class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/Baldness_treatments#_note-liang2\">[4]</a></sup> <sup class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/Baldness_treatments#_note-niederprum\">[5]</a></sup> ), in their free form, that come from the bulk de-<a href=\"http://en.wikipedia.org/wiki/Esterification\" title=\"Esterification\">esterification</a> of natural oils like <a href=\"http://en.wikipedia.org/wiki/Borage_seed_oil\" title=\"Borage seed oil\">borage seed oil</a> and <a href=\"http://en.wikipedia.org/wiki/Linseed_oil\" title=\"Linseed oil\">linseed oil</a>.</p> </body> </html>"
