  name: Hyper.1
  updated_at: 2007-04-25 20:45:21
  body_html: "<p><font face=\"Verdana, Arial, Helvetica, sans-serif\" size=\"2\">                          Hyperalgesia: Certain noxious stimuli (e.g. severe bruising)                          can result in the individual perceiving abnormally high                          levels of pain in response to normal noxious stimuli such                          as a small scratch; in such cases, patients often perceive                          spontaneous pain <font size=\"-2\">1,2,4</font></font></p><p>&nbsp;<font face=\"Verdana, Arial, Helvetica, sans-serif\" size=\"2\"><strong>References:</strong></font></p>               <p><font face=\"Verdana, Arial, Helvetica, sans-serif\" size=\"2\">1.                  Kandel ER, Schwartz JH, Jessell TM, editors. Principles of Neural                  Science (Fourth Edition). New York: McGraw Hill (Health Professions                  Division). 2000;472-491. </font></p>               <p><font face=\"Verdana, Arial, Helvetica, sans-serif\" size=\"2\">2.                  Millan MJ. Progress in Neurobiology 1999;57:1-164. </font></p>               <p><font face=\"Verdana, Arial, Helvetica, sans-serif\" size=\"2\">3.                  Dickenson AH. Brit J Anaesthesia 1995;75:193-200. </font></p>               <p><font face=\"Verdana, Arial, Helvetica, sans-serif\" size=\"2\">4.                  Suzuki R and Dickenson AH. Neuroreport 2000;11:R17-21. </font></p>               <p><font face=\"Verdana, Arial, Helvetica, sans-serif\" size=\"2\">5.                  Waxman S. Pain 1999;6:S133-140. </font></p><p>&nbsp;</p>"
