project_contents_035: 
  name: ProjectContent-51
  updated_at: 2007-04-30 14:11:06
  body_html: <?xml version="1.0" encoding="utf-8"?> <!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Transitional//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd"> <html xmlns="http://www.w3.org/1999/xhtml" lang="en" xml:lang="en"> <head> 	<title>Untitled document</title> 	<meta http-equiv="Content-Type" content="text/html; charset=utf-8" /> </head> <body> <a href="http://en.wikipedia.org/wiki/Ketoconazole" title="Ketoconazole">Ketoconazole</a> is a synthetic <a href="http://en.wikipedia.org/wiki/Antifungal_drug" title="Antifungal drug">antifungal drug</a> used to <a href="http://en.wikipedia.org/wiki/Prophylaxis" title="Prophylaxis">prevent</a> and treat skin and fungal infections, especially in <a href="http://en.wikipedia.org/wiki/Immune_deficiency" title="Immune deficiency">immunocompromised</a> patients such as those with <a href="http://en.wikipedia.org/wiki/AIDS" title="AIDS">AIDS</a>. Because it is both an anti-fungal and also a <a href="http://en.wikipedia.org/wiki/5-alpha_reductase" title="5-alpha reductase">5-alpha reductase</a> inhibitor, it can help to slow the balding process. <sup class="reference"><a href="http://en.wikipedia.org/wiki/Baldness_treatments#_note-HugoPerez">[6]</a></sup> <sup class="reference"><a href="http://en.wikipedia.org/wiki/Baldness_treatments#_note-pierard">[7]</a></sup> There has been some suggestion that ketoconazole could inhibit testosterone synthesis in utero, which could potentially inhibit genital development of a male fetus. However, this has not been documented in any controlled studies. <sup class="reference"><a href="http://en.wikipedia.org/wiki/Baldness_treatments#_note-0">[8]</a></sup> </body> </html>
