project_contents_013: 
  name: pain-1
  updated_at: 2007-04-25 21:16:34
  body_html: "<?xml version=\"1.0\" encoding=\"utf-8\"?> <!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\" \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\"> <html xmlns=\"http://www.w3.org/1999/xhtml\" lang=\"en\" xml:lang=\"en\"> <head> \t<title>Untitled document</title> \t<meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\" /> </head> <body> <font face=\"Verdana, Arial, Helvetica, sans-serif\"><strong><font size=\"2\">Allodynia</font></strong></font>                     <ul><li><font face=\"Verdana, Arial, Helvetica, sans-serif\" size=\"2\">                          Tissue injury often results in nociceptive pain, in which                          persistent pain is felt in response to direct activation                          of peripheral nerve terminals in the skin by pain response                          mediators from the damaged tissue<font size=\"-2\"> 1,2                          </font></font></li><li><font face=\"Verdana, Arial, Helvetica, sans-serif\" size=\"2\">                          Nociceptive pain: Following tissue injury, Substance P,                          CGRP and glutamate are released by peripheral afferent                          sensory fibers and act on peptide and glutamate receptors                          on the post-synaptic membrane to cause greater excitability                          of nociceptive neurons. Nociceptive neurons become hyperexcitable,                          resulting in central sensitization and thus greater perception                          of pain in the higher centers <font size=\"-2\">1,2,3</font></font></li><li><font face=\"Verdana, Arial, Helvetica, sans-serif\" size=\"2\">                          Nociceptive pain may involve the abnormal pain states                          of allodynia or hyperalgesia which result from both peripheral                          and central hypersensitivity <font size=\"-2\">1,2,3</font></font></li><li><font face=\"Verdana, Arial, Helvetica, sans-serif\" size=\"2\">                          Allodynia: Certain types of noxious stimulus (e.g. sunburn,                          injury, post-surgical wounds) may result in the individual                          perceiving pain in response to stimuli that are not normally                          painful, such as a light stroking of the skin<font size=\"-3\">                          1,2,4 </font></font></li></ul> </body> </html>"
