  body_html: "<?xml version=\"1.0\" encoding=\"utf-8\"?> <!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\" \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\"> <html xmlns=\"http://www.w3.org/1999/xhtml\" lang=\"en\" xml:lang=\"en\"> <head> \t<title>Untitled document</title> \t<meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\" /> </head> <body><h2>  Logistics</h2><table border=\"1\"><tbody><tr><td style=\"text-align: right\">&nbsp;Site:</td><td style=\"font-weight: bold\">&nbsp;Aldershot</td></tr><tr><td style=\"text-align: right\">&nbsp;Group:</td><td style=\"font-weight: bold\">The Edge&nbsp;</td></tr><tr><td style=\"text-align: right\">&nbsp;Start Date:<br /></td><td style=\"font-weight: bold\">&nbsp;</td></tr><tr><td style=\"text-align: right\">&nbsp;End Date:<br /></td><td style=\"font-weight: bold\">&nbsp;</td></tr></tbody></table><h2>&nbsp;Assay Details</h2><table border=\"1\" cellspacing=\"3\" cellpadding=\"3\"><tbody><tr><td style=\"text-align: right; font-style: italic\">Target&nbsp;</td><td style=\"font-weight: bold\">T1&nbsp;</td></tr><tr><td style=\"text-align: right; font-style: italic\">&nbsp;Reagent Information<br /></td><td style=\"font-weight: bold\">&nbsp;&lt;Add biological reagent information&gt;</td></tr><tr><td style=\"text-align: right; font-style: italic\">&nbsp;Study Design<br /></td><td style=\"font-weight: bold\">&nbsp;&lt;FullScreen&gt;</td></tr><tr><td style=\"text-align: right; font-style: italic\">&nbsp;Lab Notebook Pages<br /></td><td style=\"font-weight: bold\">&nbsp;&lt;Add lnb numbers for assay development&gt;</td></tr></tbody></table>  </body> </html>"
