project_contents_036: 
  name: ProjectContent-52
  updated_at: 2007-04-30 14:11:39
  body_html: <?xml version="1.0" encoding="utf-8"?> <!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Transitional//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd"> <html xmlns="http://www.w3.org/1999/xhtml" lang="en" xml:lang="en"> <head> 	<title>Untitled document</title> 	<meta http-equiv="Content-Type" content="text/html; charset=utf-8" /> </head> <body> <a href="http://en.wikipedia.org/wiki/Saw_palmetto" title="Saw palmetto">Saw palmetto</a> (<em>Serenoa repens</em>) is an <a href="http://en.wikipedia.org/wiki/Herbal_medicine" title="Herbal medicine">herbal</a> DHT inhibitor which is cheaper than most commercial drugs and is claimed to have fewer side effects than finasteride and dutasteride. Unlike other 5-alpha-reductase inhibitors, saw palmetto extract inhibits the conversion of testosterone to DHT without interfering with the cellular capacity to secrete <a href="http://en.wikipedia.org/wiki/Prostate_specific_antigen" title="Prostate specific antigen">PSA</a>.<sup class="reference"><a href="http://en.wikipedia.org/wiki/Baldness_treatments#_note-habib">[9]</a></sup> Saw palmetto extract has been demonstrated to inhibit both isoforms of alpha-5-reductase unlike finasteride which only inhibits the (predominant) type 2 isoenzyme of alpha-5-reductase.<sup class="reference"><a href="http://en.wikipedia.org/wiki/Baldness_treatments#_note-prager">[10]</a></sup> <sup class="reference"><a href="http://en.wikipedia.org/wiki/Baldness_treatments#_note-marks">[11]</a></sup> It must be noted that DHT inhibition <a href="http://en.wikipedia.org/wiki/In_vitro" title="In vitro">in vitro</a> does not necessarily imply inhibition <a href="http://en.wikipedia.org/wiki/In_vivo" title="In vivo">in vivo</a>. A preliminary study of saw palmetto extract for treating hair loss noted improvement in six of ten subjects over a six month period. Dosages were not reported. <sup class="reference"><a href="http://en.wikipedia.org/wiki/Baldness_treatments#_note-prager">[10]</a></sup> The small size of the study and its relatively short duration limit must be noted. <p>There hasn&#39;t been a single reputable study done showing that Saw Palmetto has any effect on treating hair loss. One study can be found in PubMed, but it was run by the makers of a saw palmetto product, and was publicly labeled as &quot;Bunk&quot; on 20/20 in January 2003 on nationwide television because it only included 10 participants and lasted only 6 months. <sup class="reference"><a href="http://en.wikipedia.org/wiki/Baldness_treatments#_note-marks">[11]</a></sup></p> </body> </html>
