project_contents_037: 
  name: ProjectContent-53
  updated_at: 2007-04-30 14:12:10
  body_html: "<?xml version=\"1.0\" encoding=\"utf-8\"?> <!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\" \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\"> <html xmlns=\"http://www.w3.org/1999/xhtml\" lang=\"en\" xml:lang=\"en\"> <head> \t<title>Untitled document</title> \t<meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\" /> </head> <body> Copper peptides are applied topically to the scalp, and shorten the resting phase of hairs, resulting in more hair follicles on the scalp being in the growing phase (as opposed to the resting or falling out phase) at one time. Copper peptides generally have <a href=\"http://en.wikipedia.org/wiki/Superoxide\" title=\"Superoxide\">superoxide</a> <a href=\"http://en.wikipedia.org/wiki/Dismutation\" title=\"Dismutation\">dismutation</a> activity. See <a rel=\"nofollow\" href=\"http://www.drproctor.com/patents/pro876.html\" title=\"http://www.drproctor.com/patents/pro876.html\" class=\"external text\">US patent 5,470,876, &quot;Topical SOD for treating hair loss&quot;</a>. There is a strong belief in the hair loss treatment community that SOD based treatments may reduce scalp irritation and dandruff often associated with hair loss, and other hair loss treatments. <p>SOD&#39;s likely work by destroying superoxide, the antagonist to <a href=\"http://en.wikipedia.org/wiki/Nitric_oxide\" title=\"Nitric oxide\">Nitric oxide</a> (NO), the natural form of minoxidil. Superoxide has an &quot;agonist-antagonist&quot; relationship with Nitric oxide or &quot;Endothelium-derived Relaxing Factor&quot;. See <a rel=\"nofollow\" href=\"http://www.drproctor.com/Archd.htm\" title=\"http://www.drproctor.com/Archd.htm\" class=\"external text\">&quot;Endothelium-Derived Relaxing Factor and Minoxidil: Active Mechanisms in Hair Growth&quot;, <em>Archives in Dermatology</em>, vol 125, August, 1989</a></p> <p>A product called Tricomin, released by Procyte, based on Copper Peptides was shown in FDA studies to produce results similar to 2% minoxidil. FDA studies were discontinued, according to Procyte, because of the expense. While by today&#39;s standards these results are quite sub-par, compounds based on this formula are licensed by Procyte to &quot;cosmo-ceutical&quot; makers, and have been shown in clinical studies to help hair grafts take after the transplant.<sup class=\"noprint Template-Fact\"><a href=\"http://en.wikipedia.org/wiki/Wikipedia:Citing_sources\" title=\"Wikipedia:Citing sources\"><span style=\"white-space: nowrap\">[<em>citation needed</em>]</span></a></sup></p> </body> </html>"
