project_contents_049: 
  name: ProjectContent-66
  updated_at: 2007-04-30 06:18:03
  body_html: "<?xml version=\"1.0\" encoding=\"utf-8\"?> <!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\" \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\"> <html xmlns=\"http://www.w3.org/1999/xhtml\" lang=\"en\" xml:lang=\"en\"> <head> \t<title>Untitled document</title> \t<meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\" /> </head> <body>   <p class=\"MsoBodyText2\"><span>The rats are anesthetized with an i.p. injection of ketamine (75 mg/kg) and xylazine (10 mg/kg). The dorsal aspect of the back is shaved and scrubbed with betadine solution. An adequate depth of anesthesia is determined by monitoring the corneal reflex. A laminectomy is performed at T9-T10 level exposing the cord without disrupting the dura mater. The spinous processes of T8 and T11 are clamped to stabilize the spine, and the exposed dorsal surface of the cord is subjected to weight drop impact using a 10 g rod (2.5 mm in diameter) and dropped at the height of 25 mm. After the injury and vehicle or drug infusion, the muscles and skin are closed in layers.</span><span></span></p>  <p class=\"MsoBodyText2\"><span>Post-operative treatment includes saline (5 ml s.c. on days 0-7 or until needed) for re-hydration. <span>Manual bladder expression is performed twice daily until reflex bladder emptying is established. Recovery of the bladder control is recorded. </span>During the first week post-injury, the bedding is changed daily.<span> </span>At the time of sacrifice, spinal cord compression is examined by inspection of the dorsal cord surface for any gross deformity.</span></p>  <h2 style=\"margin-left: 0pt; text-indent: 0pt\"><a name=\"_Toc158620473\"></a><a name=\"_Toc152059705\"></a><span><!--[if !supportLists]--><span style=\"font-family: Arial; font-weight: normal\"></span><font size=\"3\"><span style=\"font-family: Arial; font-weight: normal\">Drug Delivery</span></font></span><font size=\"3\"><span style=\"font-family: Arial; font-weight: normal\"></span></font></h2>  <p style=\"margin-left: 0pt; text-align: justify\" class=\"MsoNormalIndent\"><span style=\"font-weight: normal\">Twenty minutes after SCI the femoral vein is cannulated. Vehicle or specified dosing of XXXX is infused using PE-10 tubing connected to 5 ml syringe in an infusion syringe pump (Univentor 801, TSE Systems, Germany). The infusion time is 50 min and the XXXX concentrations applied are XX (low dose), XX (medium dose) and XX (high dose) &micro;g/&micro;l. The infusion rate is 300 &micro;l/kg/min for the first 5 min, and 100 &micro;l/kg/min after that. After infusion is complete, the cannula is removed and the femoral vein occluded. The wound is closed, disinfected and the rat is allowed to recover.</span></p>   </body> </html>"
