  body_html: <?xml version="1.0" encoding="utf-8"?> <!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Transitional//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd"> <html xmlns="http://www.w3.org/1999/xhtml" lang="en" xml:lang="en"> <head> 	<title>Untitled document</title> 	<meta http-equiv="Content-Type" content="text/html; charset=utf-8" /> </head> <body> In animal models, the nitroxide spin labels TEMPO and TEMPOL enhance hair regrowth following radiation. National Cancer Institute-sponsored clinical trials <a rel="nofollow" href="http://clincancerres.aacrjournals.org/cgi/content/full/10/19/6411" title="http://clincancerres.aacrjournals.org/cgi/content/full/10/19/6411" class="external text">report</a> TEMPOL is similarly effective in humans. Also see United States Patent 5,714,482 &quot;Topical spin labels and method&quot;. </body> </html>
