"\" width=\"23\" height=\"22\" /><!--[endif]-->.</span><span style=\"font-weight: normal\"></span></p>  <p style=\"margin-right: 28.1pt; text-align: justify\" class=\"MsoNormal\"><span><!--[if gte vml 1]><v:shape id=\"_x0000_i1026\" type=\"#_x0000_t75\"  style='width:402.75pt;height:48pt' o:ole=\"\">  <v:imagedata src=\"file:///C:\\DOCUME~1\\alemon\\LOCALS~1\\Temp\\msohtml1\\01\\clip_image003.gif\"   o:title=\"\"/> </v:shape><![endif]--><!--[if !vml]--><br /><!--[endif]--><!--[if gte mso 9]><xml>  <o:OLEObject Type=\"Embed\" ProgID=\"MSPhotoEd.3\" ShapeID=\"_x0000_i1026\"   DrawAspect=\"Content\" ObjectID=\"_1239776444\">  </o:OLEObject> </xml><![endif]--></span><span style=\"font-size: 10pt\"></span></p>    <div>  <table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" align=\"center\">  <tbody><tr>   <td align=\"left\" valign=\"top\" style=\"padding: 0pt 9.35pt\">   <div style=\"border-style: solid none; border-color: silver -moz-use-text-color; border-width: 6pt medium; padding: 12pt 0pt; margin-left: 0pt; margin-right: 28.1pt\">   <p style=\"border: medium none ; padding: 0pt; margin-bottom: 0.0001pt; text-align: center\" class=\"MsoNormal\" align=\"center\"><span style=\"font-size: 20pt; color: black; font-weight: normal\">Traumatic Spinal Cord Injury in Rats</span></p>   <p style=\"border: medium none ; padding: 0pt; margin-bottom: 0.0001pt; text-align: center\" class=\"MsoNormal\" align=\"center\"><span style=\"font-size: 20pt; color: black; font-weight: normal\">- Efficacy Study with XXXX</span></p>   </div>   </td>  </tr> </tbody></table>  </div>  <p style=\"text-align: justify\" class=\"MsoNormal\"><span>&nbsp;</span></p>  <div>  <table border=\"0\" cellspacing=\"0\" cellpadding=\"0\">  <tbody><tr>   <td align=\"left\" valign=\"top\" style=\"padding: 0pt 9.35pt\">   <p style=\"background: white none repeat scroll 0% 50%; margin-bottom: 6pt; text-align: justify; -moz-background-clip: -moz-initial; -moz-background-origin: -moz-initial; -moz-background-inline-policy: -moz-initial\" class=\"HangingText2\"><span style=\"font-weight: normal\">Author:<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Partners </span>UK Ltd.</span></p>   <p style=\"background: white none repeat scroll 0% 50%; margin-bottom: 6pt; text-align: justify; -moz-background-clip: -moz-initial; -moz-background-origin: -moz-initial; -moz-background-inline-policy: -moz-initial\" class=\"HangingText2\"><span style=\"font-weight: normal\">File name:<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>SCI   model &ndash; Efficacy study with XXXX</span></p>      <p style=\"background: white none repeat scroll 0% 50%; margin-bottom: 6pt; text-align: justify; -moz-background-clip: -moz-initial; -moz-background-origin: -moz-initial; -moz-background-inline-policy: -moz-initial\" class=\"HangingText2\"><span style=\"font-weight: normal\">Revision:<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>0.1</span></p>   <p style=\"background: white none repeat scroll 0% 50%; margin-bottom: 6pt; text-align: justify; -moz-background-clip: -moz-initial; -moz-background-origin: -moz-initial; -moz-background-inline-policy: -moz-initial\" class=\"HangingText2\"><span style=\"font-weight: normal\">Date:<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><a name=\"SaveDateOnCoverPage\"></a>2007-04-24</span></p></td></tr></tbody></table></div></div><h1><strong></strong><strong></strong><a name=\"_Toc67801561\"></a><a name=\"_Toc158620467\"></a><a name=\"_Toc152059699\"></a><span><span><!--[if !supportLists]--><span style=\"font-family: Arial; font-weight: normal\"><span>1 </span></span><!--[endif]--><span style=\"font-family: Arial; font-weight: normal\">Purpose of Study</span></span></span><span><span style=\"font-family: Arial; font-weight: normal\"></span></span></h1>  <p style=\"margin-left: 0pt; text-align: justify\" class=\"MsoNormalIndent\"><span><span style=\"font-weight: normal\">The purpose of this study is to investigate whether different doses of XXXX provides functional recovery in a rat model of </span></span><span><span style=\"font-weight: normal\">traumatic spinal cord injury (</span></span><span><span style=\"font-weight: normal\">SCI). Injury of SCI is produced by T10 contusion in Sprague-Dawley (SD) rats. XXXX is administered intravenously after the SCI, and the animals are evaluated for locomotor function and coordinated hind limb functions for 21 days. At the end of the experiment, the spinal cord is dissected, processed and histopathologically examined. The injury volume, spared white matter and viability of ventral horn motor neurons at levels adjacent to the lesion epicenter are investigated.</span></span></p>  <h1 style=\"margin-left: 0pt; text-align: justify; text-indent: 0pt\"><span><a name=\"_Toc158620468\"></a><a name=\"_Toc152059700\"></a><span><!--[if !supportLists]--><span style=\"font-family: Arial; font-weight: normal\"><span>2 </span></span><!--[endif]--><span style=\"font-family: Arial; font-weight: normal\">Background</span></span></span><span><span style=\"font-family: Arial; font-weight: normal\"></span></span></h1>  <p style=\"margin-left: 0pt; text-align: justify\" class=\"MsoNormalIndent\"><span><span style=\"font-weight: normal\">Traumatic SCI causes permanent neurological deficits due to the loss of spinal cord neurons and axons. The central region of the spinal cord suffers critical damage by the primary mechanical stress and shows hemorrhagic necrosis. Unlike the primary trauma, which is immediate and beyond therapeutic management, the secondary injury occurs over the hours and days after SCI, further exacerbating tissue loss and neurological impairment. </span></span></p>    <h1 style=\"margin-left: 0pt; text-align: justify; text-indent: 0pt\"><a name=\"_Toc158620469\"></a><a name=\"_Toc152059701\"></a><span><!--[if !supportLists]--><span style=\"font-family: Arial; font-weight: normal\"><span>3 </span></span><!--[endif]--><span style=\"font-family: Arial; font-weight: normal\">Materials and Methods</span></span><span style=\"font-family: Arial; font-weight: normal\"></span></h1>  <h2 style=\"margin-left: 0pt; text-indent: 0pt\"><a name=\"_Toc158620470\"></a><a name=\"_Toc152059702\"></a><span><!--[if !supportLists]--><span style=\"font-family: Arial; font-weight: normal\"><span>3.1 </span></span><!--[endif]--><span style=\"font-family: Arial; font-weight: normal\">Animals</span></span><span style=\"font-family: Arial; font-weight: normal\"></span></h2>  <p class=\"MsoBodyText2\"><span>All animal experiments are carried out according to the National Institute of Health (NIH) guidelines for the care and use of laboratory animals, and approved by the Ethical Committee of the National Laboratory Animal Center, Kuopio, Finland. Altogether 48 adult female Sprague-Dawley rats (Taconic,  Denmark) weighing 200-240 g are used. Animals are housed at a standard temperature (22 &plusmn; 1</span><span>&deg;</span><span>C) and in a light-controlled environment (lights on from 7 am to 8 pm) with <em>ad libitum</em> access to food and water.</span></p>  <p class=\"MsoBodyText2\"><span>Animals are grouped as follows:</span></p>  <p style=\"margin-left: 35.7pt; text-indent: -17.85pt\" class=\"MsoBodyText2\"><!--[if !supportLists]--><span style=\"font-family: Wingdings\"><span>&sect;<span style=\"font-family: &quot;Times New Roman&quot;; font-style: normal; font-variant: normal; font-weight: normal; font-size: 7pt; line-height: normal; font-size-adjust: none; font-stretch: normal\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><span>12 rats treated with </span><span>Vehicle (i.v., xxx mg/kg, ml/kg) 20 min after SCI<em></em></span></p>  <p style=\"margin-left: 35.7pt; text-indent: -17.85pt\" class=\"MsoBodyText2\"><!--[if !supportLists]--><span style=\"font-family: Wingdings\"><span>&sect;<span style=\"font-family: &quot;Times New Roman&quot;; font-style: normal; font-variant: normal; font-weight: normal; font-size: 7pt; line-height: normal; font-size-adjust: none; font-stretch: normal\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><span>12 rats treated with low dose of XXXX </span><span>(i.v., xxx mg/kg, ml/kg) 20 min after SCI</span><em><span></span></em></p>  <p style=\"margin-left: 35.7pt; text-indent: -17.85pt\" class=\"MsoBodyText2\"><!--[if !supportLists]--><span style=\"font-family: Wingdings\"><span>&sect;<span style=\"font-family: &quot;Times New Roman&quot;; font-style: normal; font-variant: normal; font-weight: normal; font-size: 7pt; line-height: normal; font-size-adjust: none; font-stretch: normal\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><span>12 rats treated with medium dose of XXXX </span><span>(i.v., xxx mg/kg, ml/kg) 20 min after SCI</span><span> </span><em><span></span></em></p>  <p style=\"margin-left: 35.7pt; text-indent: -17.85pt\" class=\"MsoBodyText2\"><!--[if !supportLists]--><span style=\"font-family: Wingdings\"><span>&sect;<span style=\"font-family: &quot;Times New Roman&quot;; font-style: normal; font-variant: normal; font-weight: normal; font-size: 7pt; line-height: normal; font-size-adjust: none; font-stretch: normal\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><span>12 rats treated with high dose of XXXX </span><span>(i.v., xxx mg/kg, ml/kg) 20 min after SCI</span><em><span></span></em></p>  <p style=\"margin-left: 17.85pt\" class=\"MsoBodyText2\"><em><span>&nbsp;</span></em></p>  <h2 style=\"margin-left: 0pt; text-indent: 0pt\"><a name=\"_Toc152059704\"></a><span><span style=\"font-family: Arial; font-weight: normal\"><span>3.3 </span></span><!--[endif]--><span style=\"font-family: Arial; font-weight: normal\">Schedule</span></span></h2><p>Study is done in three parts, preparation, data capture and analysis.</p><p>&nbsp;</p><h2 style=\"margin-left: 21.3pt; text-indent: -14.2pt\"><a name=\"_Toc158620471\"></a><a name=\"_Toc152059703\"></a><span><!--[if !supportLists]--><span style=\"font-family: Arial; font-weight: normal\"></span></span></h2><br /><h2 style=\"margin-left: 0pt; text-indent: 0pt\"><a name=\"_Toc158620472\"></a><a name=\"_Toc152059704\"></a><span><!--[if !supportLists]--><span style=\"font-family: Arial; font-weight: normal\"><span>3.3 </span></span><!--[endif]--><span style=\"font-family: Arial; font-weight: normal\">Spinal Cord Contusion</span></span><span style=\"font-family: Arial; font-weight: normal\"></span></h2>  <p class=\"MsoBodyText2\"><span>The rats are anesthetized with an i.p. injection of ketamine (75 mg/kg) and xylazine (10 mg/kg). The dorsal aspect of the back is shaved and scrubbed with betadine solution. An adequate depth of anesthesia is determined by monitoring the corneal reflex. A laminectomy is performed at T9-T10 level exposing the cord without disrupting the dura mater. The spinous processes of T8 and T11 are clamped to stabilize the spine, and the exposed dorsal surface of the cord is subjected to weight drop impact using a 10 g rod (2.5 mm in diameter) and dropped at the height of 25 mm. After the injury and vehicle or drug infusion, the muscles and skin are closed in layers.</span><span></span></p>  <p class=\"MsoBodyText2\"><span>Post-operative treatment includes saline (5 ml s.c. on days 0-7 or until needed) for re-hydration. <span>Manual bladder expression is performed twice daily until reflex bladder emptying is established. Recovery of the bladder control is recorded. </span>During the first week post-injury, the bedding is changed daily.<span> </span>At the time of sacrifice, spinal cord compression is examined by inspection of the dorsal cord surface for any gross deformity.</span></p>  <h2 style=\"margin-left: 0pt; text-indent: 0pt\"><a name=\"_Toc158620473\"></a><a name=\"_Toc152059705\"></a><span><!--[if !supportLists]--><span style=\"font-family: Arial; font-weight: normal\"><span>3.4 </span></span><!--[endif]--><span style=\"font-family: Arial; font-weight: normal\">Drug Delivery</span></span><span style=\"font-family: Arial; font-weight: normal\"></span></h2>  <p style=\"margin-left: 0pt; text-align: justify\" class=\"MsoNormalIndent\"><span style=\"font-weight: normal\">Twenty minutes after SCI the femoral vein is cannulated. Vehicle or specified dosing of XXXX is infused using PE-10 tubing connected to 5 ml syringe in an infusion syringe pump (Univentor 801, TSE Systems, Germany). The infusion time is 50 min and the XXXX concentrations applied are XX (low dose), XX (medium dose) and XX (high dose) &micro;g/&micro;l. The infusion rate is 300 &micro;l/kg/min for the first 5 min, and 100 &micro;l/kg/min after that. After infusion is complete, the cannula is removed and the femoral vein occluded. The wound is closed, disinfected and the rat is allowed to recover.</span></p>  <h2 style=\"margin-left: 14.2pt; text-indent: -14.2pt\"><a name=\"_Toc158620474\"></a><a name=\"_Toc152059706\"></a><span><!--[if !supportLists]--><span style=\"font-family: Arial; font-weight: normal\"><span>3.5 </span></span><!--[endif]--><span style=\"font-family: Arial; font-weight: normal\">Body Weight</span></span><span style=\"font-family: Arial; font-weight: normal\"></span></h2>  <p style=\"margin-left: 0pt; text-align: justify\" class=\"MsoNormalIndent\"><span style=\"font-weight: normal\">The body weight of the rats is measured pre-SCI and on days 1, 7, 14, and 21 after the surgery.</span></p>  <h2 style=\"margin-left: 14.2pt; text-indent: -14.2pt\"><a name=\"_Toc158620475\"></a><a name=\"_Toc152059707\"></a><span><!--[if !supportLists]--><span style=\"font-family: Arial; font-weight: normal\"><span>3.6 </span></span><!--[endif]--><span style=\"font-family: Arial; font-weight: normal\">BBB Open-Field Locomotor Function Test</span></span><span style=\"font-family: Arial; font-weight: normal\"></span></h2>  <p class=\"MsoBodyText2\"><span>Open field locomotor function is evaluated using the Basso, Beattie, and Bresnahan (BBB) locomotor test (Basso et al. J. Neurotrauma 12, 1&ndash;21, 1995). The BBB scale ranges from 0 (no hindlimb movement) to 21 (normal movement-coordinated gait with parallel paw placement). Scores from 0 to 7 indicate the return of isolated movements in the three joints (hip, knee, and ankle). Scores from 8 to 13 indicate the return of paw placement and coordinated movements with the forelimbs. Scores from 14 to 21 show the return of toe clearance during stepping, predominant paw position, trunk stability, and tail position. BBB scores are measured pre-SCI (baseline) and on days 1, 7, 14, and 21 post-surgery.</span></p>  <h2 style=\"margin-left: 14.2pt; text-indent: -14.2pt\"><a name=\"_Toc158620476\"></a><a name=\"_Toc152059708\"></a><span><!--[if !supportLists]--><span style=\"font-family: Arial; font-weight: normal\"><span>3.7 </span></span><!--[endif]--><span style=\"font-family: Arial; font-weight: normal\">Paw Placement and Toe Spread Tests</span></span><span style=\"font-family: Arial; font-weight: normal\"></span></h2>  <p style=\"margin-left: 0pt; text-align: justify\" class=\"MsoNormalIndent\"><span style=\"font-weight: normal\">Reflexes of hind limbs are tested pre-injury and </span><span style=\"font-weight: normal\">on days 1, 7, 14, and 21 post-</span><span style=\"font-weight: normal\">injury. Reflexes of toe spread and paw placement are scored 0 = no reflex, 1 = considerably weaker than normal, 2 = slightly weaker than normal, 3 = normal.</span></p>  <h2 style=\"margin-left: 14.2pt; text-indent: -14.2pt\"><a name=\"_Toc158620477\"></a><a name=\"_Toc152059709\"></a><span><!--[if !supportLists]--><span style=\"font-family: Arial; font-weight: normal\"><span>3.8 </span></span><!--[endif]--><span style=\"font-family: Arial; font-weight: normal\">Open Arena Test</span></span><span style=\"font-family: Arial; font-weight: normal\"></span></h2>  <p class=\"MsoBodyText2\"><span>Behavioral response in open field arena reflects both rats&rsquo; exploratory activity and its natural neophobia. Testing is performed at pre-injury and on days 8, and 20 post-SCI in an open-field arena (square 40&times;40&times;40 cm) constructed of Plexiglas. The paths of the rats are recorded by TrueScan Photo Beam Activity system (Coulbourn Instruments). The rat is placed in the center of the arena, and the path is recorded for 10 min. The arena is divided into 16 cells and the following parameters are analyzed: 1) path length, 2) % time moving, 3) number of vertical rearings, and 4) time used for vertical rearing. </span></p>  <h2 style=\"margin-left: 14.2pt; text-indent: -14.2pt\"><a name=\"_Toc158620478\"></a><a name=\"_Toc152059710\"></a><span><!--[if !supportLists]--><span style=\"font-family: Arial; font-weight: normal\"><span>3.9 </span></span><!--[endif]--><span style=\"font-family: Arial; font-weight: normal\">Histopathological Examination</span></span><span style=\"font-family: Arial; font-weight: normal\"></span></h2>  <h3 style=\"margin-left: 0pt; text-indent: 0pt\"><a name=\"_Toc158620479\"></a><a name=\"_Toc152059711\"></a><span><!--[if !supportLists]--><span style=\"font-family: Arial; font-weight: normal\"><span>3.9.1 </span></span><!--[endif]--><span style=\"font-family: Arial; font-weight: normal\">Perfusion, Cryoprotection, Freezing and Storage</span></span><span style=\"font-family: Arial; font-weight: normal\"> </span></h3>  <p style=\"text-align: justify\" class=\"MsoNormal\"><span style=\"font-weight: normal\">On day 21 post-injury, the rats are terminally anesthetized with pentobarbital and perfused transcardially with heparinized (2.5 IU/ml) saline followed by 4% formaldehyde in phosphate buffer. Spinal cord tissue is removed from the vertebral canal, and a 2.0 cm segment centered at the injury site is excised and fixed by immersion in 4% formaldehyde in phosphate buffer </span><span style=\"font-weight: normal\">for an additional 24 h at +4&deg;C</span><span style=\"font-weight: normal\">. After cryoprotection in 30% sucrose in phosphate buffer for 2-3 days, spinal cords are frozen on liquid nitrogen, and stored at -80</span><span style=\"font-weight: normal\">&deg;C.</span><span style=\"font-weight: normal\"> </span></p>  <h3 style=\"margin-left: 0pt; text-indent: 0pt\"><a name=\"_Toc158620480\"></a><a name=\"_Toc152059712\"></a><span><!--[if !supportLists]--><span style=\"font-family: Arial; font-weight: normal\"><span>3.9.2 </span></span><!--[endif]--><span style=\"font-family: Arial; font-weight: normal\">Cryosectioning and Histological Analysis</span></span><span style=\"font-family: Arial; font-weight: normal\"></span></h3>  <p style=\"text-align: justify\" class=\"MsoNormal\"><span style=\"font-weight: normal\">20-&micro;m-thick sections are prepared with a cryostat and mounted sequentially on 5 Superfrost plus slides. Sections are made on 400 &micro;m intervals.<span style=\"background: red none repeat scroll 0% 50%; -moz-background-clip: -moz-initial; -moz-background-origin: -moz-initial; -moz-background-inline-policy: -moz-initial\"></span></span></p>  <p style=\"text-align: justify\" class=\"MsoNormal\"><span style=\"font-weight: normal\">One slide per series is stained with Giemsa staining and examined to identify the injury epicenter (region of maximal damage).<span>&nbsp; </span>Stained sections at the lesion epicenter and 0.8, 1.6, 2.4, 3.2 and 4 mm rostral and caudal to the epicenter are digitized and analyzed using Image Pro Plus software. Total spinal cord area, lesion area and the average area of residual white matter are determined from the sections. </span></p>  <p style=\"text-align: justify\" class=\"MsoNormal\"><span style=\"font-weight: normal\">To examine the neuronal protective effect of compounds, motor neurons of ventral horns are counted in a series of cresyl fast violet (CFV) stained sections at the lesion epicenter and at 0.8 mm increments 4 mm both rostral and caudal to the lesion epicenter.</span></p>  <h1 style=\"margin: 0pt 0pt 12pt; text-align: justify; text-indent: 0pt\"><a name=\"_Toc158620481\"></a><a name=\"_Toc152059713\"></a><span><!--[if !supportLists]--><span style=\"font-family: Arial; font-weight: normal\"><span>4 </span></span><!--[endif]--><span style=\"font-family: Arial; font-weight: normal\">Statistical Analysis</span></span><span style=\"font-family: Arial; font-weight: normal\"></span></h1>  <p style=\"margin-bottom: 6pt\" class=\"MsoBodyText2\"><span>Values are presented medians or mean &plusmn; standard deviation (SD) or standard error of mean (SEM), and differences are considered to be statistically significant at the P&lt;0.05 level. Statistical analysis is performed using StatsDirect software. At separate time points, the differences among means are analyzed by 1-way-ANOVA followed by Dunnet&rsquo;s test (comparison to the control (=vehicle treated SCI rats) group). Within-group comparison to the baseline is done by 2-way-ANOVA followed by Dunnet&rsquo;s test. Non-parametric data is analyzed with Kruskal-Wallis ANOVA or Friedman ANOVA, respectively.</span></p>  <h1 style=\"margin: 0pt 0pt 12pt; text-align: justify; text-indent: 0pt\"><a name=\"_Toc158620482\"></a><a name=\"_Toc152059714\"></a><span><!--[if !supportLists]--><span style=\"font-family: Arial; font-weight: normal\"><span>5 </span></span><!--[endif]--><span style=\"font-family: Arial; font-weight: normal\">Schedule</span></span><span style=\"font-family: Arial; font-weight: normal\"></span></h1>  <p style=\"text-align: justify\" class=\"MsoBodyText\"><span style=\"font-weight: normal\">The research described is completely conducted in 3.5 months from the start of the experiment. Following is a timetable describing the detailed phases of the experiment.</span></p>  <p style=\"margin: 0pt 0pt 6pt 35.7pt; text-align: justify; text-indent: -17.85pt\" class=\"MsoBodyText\"><!--[if !supportLists]--><span style=\"font-family: Wingdings; font-weight: normal\"><span>&sect;<span style=\"font-family: &quot;Times New Roman&quot;; font-style: normal; font-variant: normal; font-weight: normal; font-size: 7pt; line-height: normal; font-size-adjust: none; font-stretch: normal\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><span style=\"font-weight: normal\">XXX Experiment started</span></p>  <p style=\"margin: 0pt 0pt 6pt 35.7pt; text-align: justify; text-indent: -17.85pt\" class=\"MsoBodyText\"><!--[if !supportLists]--><span style=\"font-family: Wingdings; font-weight: normal\"><span>&sect;<span style=\"font-family: &quot;Times New Roman&quot;; font-style: normal; font-variant: normal; font-weight: normal; font-size: 7pt; line-height: normal; font-size-adjust: none; font-stretch: normal\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><span style=\"font-weight: normal\">XXX Draft results reported</span></p>  <p style=\"margin: 0pt 0pt 6pt 35.7pt; text-align: justify; text-indent: -17.85pt\" class=\"MsoBodyText\"><!--[if !supportLists]--><span style=\"font-family: Wingdings; font-weight: normal\"><span>&sect;<span style=\"font-family: &quot;Times New Roman&quot;; font-style: normal; font-variant: normal; font-weight: normal; font-size: 7pt; line-height: normal; font-size-adjust: none; font-stretch: normal\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><span style=\"font-weight: normal\">XXX Final report</span></p>  <h1 style=\"margin: 0pt 0pt 12pt; text-align: justify; text-indent: 0pt\"><a name=\"_Toc158620483\"></a><a name=\"_Toc152059715\"></a><span><!--[if !supportLists]--><span style=\"font-family: Arial; font-weight: normal\"><span>6 </span></span><!--[endif]--><span style=\"font-family: Arial; font-weight: normal\">Documentation</span></span><span style=\"font-family: Arial; font-weight: normal\"></span></h1>  <p style=\"text-align: justify\" class=\"MsoNormal\"><span style=\"font-weight: normal\">Documentation will be done in English according to the OECD and FDA guidelines for non-clinical laboratory studies. The delivery of the reports to the customer is done by written (signed) and electronic (e-mail attachment) means.</span></p>  <h2 style=\"margin-left: 14.2pt; text-align: justify; text-indent: -14.2pt\"><a name=\"_Toc158620484\"></a><a name=\"_Toc152059716\"></a><span><!--[if !supportLists]--><span style=\"font-family: Arial; font-weight: normal\"><span>6.1 </span></span><!--[endif]--><span style=\"font-family: Arial; font-weight: normal\">Draft Results</span></span><span style=\"font-family: Arial; font-weight: normal\"></span></h2>  <p style=\"margin: 0pt 0pt 6pt 32.05pt; text-align: justify; text-indent: -17.85pt\" class=\"MsoNormal\"><!--[if !supportLists]--><span style=\"font-family: Wingdings; font-weight: normal\"><span>&sect;<span style=\"font-family: &quot;Times New Roman&quot;; font-style: normal; font-variant: normal; font-weight: normal; font-size: 7pt; line-height: normal; font-size-adjust: none; font-stretch: normal\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><span style=\"font-weight: normal\">Body weight over time</span></p>  <p style=\"margin: 0pt 0pt 6pt 32.05pt; text-align: justify; text-indent: -17.85pt\" class=\"MsoNormal\"><!--[if !supportLists]--><span style=\"font-family: Wingdings; font-weight: normal\"><span>&sect;<span style=\"font-family: &quot;Times New Roman&quot;; font-style: normal; font-variant: normal; font-weight: normal; font-size: 7pt; line-height: normal; font-size-adjust: none; font-stretch: normal\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><span style=\"font-weight: normal\">Bladder control recovery score</span></p>  <p style=\"margin: 0pt 0pt 6pt 32.05pt; text-align: justify; text-indent: -17.85pt\" class=\"MsoBodyText\"><!--[if !supportLists]--><span style=\"font-family: Wingdings; font-weight: normal\"><span>&sect;<span style=\"font-family: &quot;Times New Roman&quot;; font-style: normal; font-variant: normal; font-weight: normal; font-size: 7pt; line-height: normal; font-size-adjust: none; font-stretch: normal\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><span style=\"font-weight: normal\">BBB score over time</span></p>  <p style=\"margin: 0pt 0pt 6pt 32.05pt; text-align: justify; text-indent: -17.85pt\" class=\"MsoNormal\"><!--[if !supportLists]--><span style=\"font-family: Wingdings; font-weight: normal\"><span>&sect;<span style=\"font-family: &quot;Times New Roman&quot;; font-style: normal; font-variant: normal; font-weight: normal; font-size: 7pt; line-height: normal; font-size-adjust: none; font-stretch: normal\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><span style=\"font-weight: normal\">Open arena: Path length, % time moving, number of rearings, time used for vertical rearings at different time points</span></p>  <p style=\"margin: 0pt 0pt 6pt 32.05pt; text-align: justify; text-indent: -17.85pt\" class=\"MsoNormal\"><!--[if !supportLists]--><span style=\"font-family: Wingdings; font-weight: normal\"><span>&sect;<span style=\"font-family: &quot;Times New Roman&quot;; font-style: normal; font-variant: normal; font-weight: normal; font-size: 7pt; line-height: normal; font-size-adjust: none; font-stretch: normal\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><span style=\"font-weight: normal\">Paw placement and toe spread score</span></p>  <p style=\"margin: 0pt 0pt 6pt 32.05pt; text-align: justify; text-indent: -17.85pt\" class=\"MsoNormal\"><!--[if !supportLists]--><span style=\"font-family: Wingdings; font-weight: normal\"><span>&sect;<span style=\"font-family: &quot;Times New Roman&quot;; font-style: normal; font-variant: normal; font-weight: normal; font-size: 7pt; line-height: normal; font-size-adjust: none; font-stretch: normal\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><span style=\"font-weight: normal\">Histopathology: total spinal cord area, lesion area, residual total white matter area and average number of ventral horn neurons</span></p>  <p style=\"margin: 0pt 0pt 6pt 32.05pt; text-align: justify; text-indent: -17.85pt\" class=\"MsoNormal\"><!--[if !supportLists]--><span style=\"font-family: Wingdings; font-weight: normal\"><span>&sect;<span style=\"font-family: &quot;Times New Roman&quot;; font-style: normal; font-variant: normal; font-weight: normal; font-size: 7pt; line-height: normal; font-size-adjust: none; font-stretch: normal\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><span style=\"font-weight: normal\">Statistical significance of the tests</span><span style=\"font-weight: normal\"></span></p>  <h2 style=\"margin-left: 14.2pt; text-align: justify; text-indent: -14.2pt\"><a name=\"_Toc158620485\"></a><a name=\"_Toc152059717\"></a><span><!--[if !supportLists]--><span style=\"font-family: Arial; font-weight: normal\"><span>6.2 </span></span><!--[endif]--><span style=\"font-family: Arial; font-weight: normal\">Final Report</span></span><span style=\"font-family: Arial; font-weight: normal\"></span></h2>  <p style=\"text-align: justify\" class=\"MsoBodyText\"><span style=\"font-weight: normal\">Final report includes summary, information of the study, materials and methods, results, and conclusions.</span></p>  <h2 style=\"margin-left: 14.2pt; text-align: justify; text-indent: -14.2pt\"><a name=\"_Toc158620486\"></a><a name=\"_Toc152059718\"></a><span><!--[if !supportLists]--><span style=\"font-family: Arial; font-weight: normal\"></span></span></h2><p style=\"text-align: justify\" class=\"MsoNormal\"><span>&nbsp;</span></p>   </body> </html>"
