project_contents_039: 
  name: ProjectContent-55
  updated_at: 2007-04-30 14:13:49
  body_html: "<?xml version=\"1.0\" encoding=\"utf-8\"?> <!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\" \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\"> <html xmlns=\"http://www.w3.org/1999/xhtml\" lang=\"en\" xml:lang=\"en\"> <head> \t<title>Untitled document</title> \t<meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\" /> </head> <body> While there are a number of genetic factors which determine a person&#39;s susceptibility to androgenic alopecia including androgen receptor polymorphisms, 5-alpha-reductase levels in the scalp, androgen receptor density and distribution in the scalp, and other factors some of which may not have been discovered. Some speculate the increase in baldness in the population of Japan after World War II demonstrates that hair loss can be influenced by diet and lifestyle. Increased fat or caloric intake, decrease in <a href=\"http://en.wikipedia.org/wiki/Aerobic\" title=\"Aerobic\">aerobic</a> exercise and general &quot;westernization&quot; was accompanied by a dramatic increase in incidence of male pattern baldness.<sup class=\"noprint Template-Fact\"><a href=\"http://en.wikipedia.org/wiki/Wikipedia:Citing_sources\" title=\"Wikipedia:Citing sources\"><span style=\"white-space: nowrap\">[<em>citation needed</em>]</span></a></sup> <p>Skeptics of this analysis believe the westernization that led to increased hair loss in Japan may have occurred in the gene pool, noting the higher propensity of hair loss in American soldiers of European descent stationed in and around Japan after the war.</p> <p>Daily, vigorous aerobic exercise (as opposed to short workout periods designed to raise androgen levels and build muscle, or more sporadic exercise) and a diet which is adequate yet more moderate in terms of fat and total calorie intake have been shown to reduce baseline insulin levels as well as baseline total and free testosterone<sup class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/Baldness_treatments#_note-1\">[12]</a></sup>, which would significantly lower baseline DHT.</p> <p>Lower insulin levels and reduced stress both result in raised levels of Sex Hormone Binding Globulin (<a href=\"http://en.wikipedia.org/wiki/SHBG\" title=\"SHBG\">SHBG</a>). SHBG binds to testosterone, and prevents it from circulating free in the blood. Only free testosterone is converted to DHT. It is the level of free androgens and not total androgens which is relevant to the levels of DHT in the scalp and the progression of MPB. In short, aerobic exercise is capable of significantly lowering DHT. <sup class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/Baldness_treatments#_note-barnard1\">[13]</a></sup> <sup class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/Baldness_treatments#_note-barnard2\">[14]</a></sup></p> <p>Androgenic alopecia has been shown to correlate with metabolic syndrome. Medically increasing androgen levels does not worsen this condition, demonstrating that androgens do not cause metabolic syndrome. Instead, high insulin levels (and possibly chronic inflammation <sup class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/Baldness_treatments#_note-joffe\">[15]</a></sup>) seem the likely link in the demonstrated correlation between baldness and metabolic syndrome. This reinforces the notion that behaviors which help to keep insulin levels low and reduce chronic inflammation might also help to preserve hair. <sup class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/Baldness_treatments#_note-cikim\">[16]</a></sup> <sup class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/Baldness_treatments#_note-heald\">[17]</a></sup></p> </body> </html>"
