  body_html: "<?xml version=\"1.0\" encoding=\"utf-8\"?> <!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\" \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\"> <html xmlns=\"http://www.w3.org/1999/xhtml\" lang=\"en\" xml:lang=\"en\"> <head> \t<title>Untitled document</title> \t<meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\" /> </head> <body> <ul class=\"clearfix\"><li>K. Fecho<a href=\"javascript:popRef(&#39;a1%20a2&#39;)\" class=\"nameLink\">*<sup>,</sup>&dagger;<span class=\"tooltip\"><span class=\"item first odd\">*Department of Anesthesiology, Division of Pain Medicine</span><span class=\"item last even\">&dagger;Curriculum in Neurobiology</span></span></a> and </li><li>J. G. Valtschanoff<a href=\"javascript:popRef(&#39;a2%20a3&#39;)\" class=\"nameLink\">&dagger;<sup>,</sup>&Dagger;<span class=\"tooltip\"><span class=\"item first odd\">&dagger;Curriculum in Neurobiology</span><span class=\"item last even\">&Dagger;Department of Cell and Developmental Biology, School of Medicine, The University of North Carolina at Chapel Hill, Chapel Hill, NC, USA.</span></span></a></li></ul><ul class=\"author_affiliations\"><li><address><span class=\"first\">*Department of Anesthesiology, Division of Pain Medicine</span>, <span>&dagger;Curriculum in Neurobiology</span> and <span class=\"last\">&Dagger;Department of Cell and Developmental Biology, School of Medicine, The University of North Carolina at Chapel Hill, Chapel Hill, NC, USA.</span></address></li></ul><address class=\"author_address\">Dr Karamarie Fecho, Department of Anesthesiology, The University of North Carolina at Chapel Hill, CB #7010, 335 MacNider Hall, Chapel Hill, North Carolina 27599-7010, USA (e-mail: <a href=\"mailto:kfecho@aims.unc.edu\" class=\"externallink\">kfecho@aims.unc.edu</a>).</address><p>&nbsp;</p><p>Inbred, histocompatible Lewis and Fischer 344 rats (LEW and FIS) have been used to identify an inverse relationship between hypothalamic-pituitary-adrenal (HPA) axis activity and susceptibility to autoimmune and chronic inflammatory disorders, with LEW showing blunted HPA axis activity and increased susceptibility toward the development of autoimmunity and chronic inflammation, and FIS showing the opposite relationship. In the present study, LEW and FIS were used to determine the relationship between HPA axis function and acute inflammatory pain (carrageenan-induced hindpaw inflammation) and neuropathic pain (partial sciatic nerve ligation; PSNL). The results showed that carrageenan-induced thermal and mechanical allodynia and hyperalgesia were greater in FIS than in LEW. Similarly, FIS showed more carrageenan-induced hindpaw swelling and higher levels of myeloperoxidase (a measure of neutrophils) in the carrageenan-inflamed hindpaw. After PSNL, LEW showed a profound mechanical allodynia and hyperalgesia, whereas mechanical sensitivity in FIS was unaltered. However, FIS, but not LEW, developed thermal allodynia and hyperalgesia after PSNL. These results provide strong evidence for a positive relationship between HPA axis activity and acute inflammatory pain. The results also support a relationship between HPA axis activity and neuropathic pain, but the relationship is complex and may depend on the pain assay.</p>  </body> </html>"
