project_contents_040: 
  name: ProjectContent-56
  updated_at: 2007-04-30 14:14:52
  body_html: "<?xml version=\"1.0\" encoding=\"utf-8\"?> <!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\" \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\"> <html xmlns=\"http://www.w3.org/1999/xhtml\" lang=\"en\" xml:lang=\"en\"> <head> \t<title>Untitled document</title> \t<meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\" /> </head> <body> <a href=\"http://en.wikipedia.org/wiki/Stem_cells\" title=\"Stem cells\">Stem cells</a> and dermal papilla cells have been discovered in hair follicles and some researchers predict research on these follicular cells may lead to successes in treating baldness through <em>hair multiplication</em>, also called <em>hair cloning,</em> within three or four years<sup class=\"noprint Template-Fact\"><a href=\"http://en.wikipedia.org/wiki/Wikipedia:Citing_sources\" title=\"Wikipedia:Citing sources\"><span style=\"white-space: nowrap\">[<em>citation needed</em>]</span></a></sup>. This treatment is expected to initially work through harvesting such cells from existing follicles, multiplying them in cultures, and injecting or implanting groups of cells into the scalp. Later treatments may be able to simply signal follicle stem cells to transmit chemical signals to nearby follicle cells which have shrunk during the aging process, which respond to these signals by regenerating and once again making healthy hair. <p>Unfortunately, this new approach to treating baldness appears to be taking longer than expected. The first products are now expected to hit the market in 2009/2010. However, it remains unclear how effective they are going to be. It has been suggested that only future generations of HM will allow patients to grow as much hair as they want.</p> <p>HM is being developed by two independent companies: ARI (Aderans Research Institute, a Japanese owned company in the USA) and Intercytex, a company in Manchester(<a href=\"http://en.wikipedia.org/wiki/UK\" title=\"UK\">UK</a>).<sup class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/Baldness_treatments#_note-webmd\">[18]</a></sup> <sup class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/Baldness_treatments#_note-cbs2chicago\">[19]</a></sup></p> <p>On <a href=\"http://en.wikipedia.org/wiki/October\" title=\"October\">October</a> <a href=\"http://en.wikipedia.org/wiki/2006\" title=\"2006\">2006</a>, <a href=\"http://en.wikipedia.org/wiki/UK\" title=\"UK\">UK</a> <a href=\"http://en.wikipedia.org/wiki/Biotechnology\" title=\"Biotechnology\">biotechnology</a> firm <em>Intercytex</em> announced they have successfully tested a method of removing <a href=\"http://en.wikipedia.org/wiki/Hair_follicles\" title=\"Hair follicles\">hair follicles</a> from the back of the neck, multiplying them and then reimplanting the cells into the scalp. The initial testing resulted in 70% of male patients regrowing hair. This treatment method is expected to be available to the public by 2009 <a rel=\"nofollow\" href=\"http://news.bbc.co.uk/2/hi/health/5413382.stm\" title=\"http://news.bbc.co.uk/2/hi/health/5413382.stm\" class=\"external autonumber\">[3]</a><a rel=\"nofollow\" href=\"http://uk.news.yahoo.com/06102006/325/baldness-treating-robot-gets-funding.html\" title=\"http://uk.news.yahoo.com/06102006/325/baldness-treating-robot-gets-funding.html\" class=\"external autonumber\">[4]</a>. On October 6, 2006, the company was awarded a &pound;1.85 million ($3.63 million) grant by the UK Department of Trade and Industry (DTI) through the Technology Programme to develop an automated manufacturing process for ICX-TRC, Intercytex&rsquo;s novel hair regeneration therapy. The grant will be used primarily to develop a dedicated robotic system to support the commercial-scale production of dermal papilla (DP) cells, the main cells involved in hair regeneration and the key component of ICX-TRC.</p> <p>In January 2007, Italian stem-cell researchers say they&#39;ve come up with a new technique for curing baldness. Pierluigi Santi of a Genoa clinic said stem cells could be used to &quot;multiply&quot; hair roots. He said the clinic would be ready to perform its first hair transplants on priority patients - those who have lost their hair in fires or other accidents - within a few months. After that, he said, &quot;we&#39;ll open our doors to paying customers&quot;. Santi&#39;s approach works by splitting roots and growing new follicles.</p> </body> </html>"
