project_contents_041: 
  name: ProjectContent-57
  updated_at: 2007-04-30 14:15:43
  body_html: "<?xml version=\"1.0\" encoding=\"utf-8\"?> <!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\" \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\"> <html xmlns=\"http://www.w3.org/1999/xhtml\" lang=\"en\" xml:lang=\"en\"> <head> \t<title>Untitled document</title> \t<meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\" /> </head> <body>  <ul><li><a href=\"http://en.wikipedia.org/wiki/Azelaic_acid\" title=\"Azelaic acid\">Azelaic acid</a> - A study found a 90% inhibition of 5-alpha-reductase activity <em>in vitro</em> with an azelaic acid and <a href=\"http://en.wikipedia.org/wiki/Zinc\" title=\"Zinc\">zinc</a> combination. There was an additive effect between the two compounds.<sup class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/Baldness_treatments#_note-azelaic\">[20]</a></sup></li><li><a href=\"http://en.wikipedia.org/wiki/Spironolactone\" title=\"Spironolactone\">Spironolactone</a></li><li><a href=\"http://en.wikipedia.org/wiki/Tretinoin\" title=\"Tretinoin\">Tretinoin</a> (aka Retinoic acid and as tradename Retin-A); chemical peel stimulation of scalp)</li><li><a href=\"http://en.wikipedia.org/w/index.php?title=Regenix&amp;action=edit\" title=\"Regenix\" class=\"new\">Regenix</a></li><li><a href=\"http://en.wikipedia.org/w/index.php?title=Avacor&amp;action=edit\" title=\"Avacor\" class=\"new\">Avacor</a></li><li>LLT or Low-level Laser Therapy - Not FDA approved for hair regrowth, but only as a cosmetic hair enhancer. Treatments are administered at either a clinic or salon (most of which are in Europe), or by the individual user via a home-based portable system (for example, &quot;The Laser Comb&quot;). No official results have been proven or published regarding hair regrowth.</li><li><a href=\"http://en.wikipedia.org/wiki/Pumpkin_seed\" title=\"Pumpkin seed\">Pumpkin seed</a> - Used to aid in the breakdown of DHT by the liver.<sup class=\"noprint Template-Fact\"><a href=\"http://en.wikipedia.org/wiki/Wikipedia:Citing_sources\" title=\"Wikipedia:Citing sources\"><span style=\"white-space: nowrap\">[<em>citation needed</em>]</span></a></sup> An extract is often used, as unprocessed pumpkin seeds are high in fat which can exacerbate hair loss in susceptible patients.</li><li><a href=\"http://en.wikipedia.org/wiki/Procapil\" title=\"Procapil\">Procapil</a> manufactured by Croda International Plc</li><li><a href=\"http://en.wikipedia.org/wiki/Stinging_nettle\" title=\"Stinging nettle\">Stinging nettle</a></li><li><a href=\"http://en.wikipedia.org/wiki/Zinc\" title=\"Zinc\">Zinc</a> - While oral zinc supplementation may help prevent the conversion of testosterone to DHT, it also increases total testosterone levels<sup class=\"noprint Template-Fact\"><a href=\"http://en.wikipedia.org/wiki/Wikipedia:Citing_sources\" title=\"Wikipedia:Citing sources\"><span style=\"white-space: nowrap\">[<em>citation needed</em>]</span></a></sup>.</li><li><a href=\"http://en.wikipedia.org/w/index.php?title=Capillovie&amp;action=edit\" title=\"Capillovie\" class=\"new\">Capillovie</a> - Researched and patented by Van Dung Nguyen, L.Pharm., M.A. (Industrial pharmacy), M.Sc. (Pharmacognosy), it is presently in the process of being commercialized by Biovinam Inc., an R&amp;D company based in Quebec, Canada. It is a topic lotion whose active ingredient is a single molecule extracted from a plant, thus qualifying as a natural product. Tests have shown a decline in hair loss, and hair regrowth starting after ca. 3 months on 65% of patients. Regrown hair remain in place after patients have stopped using the lotion.</li></ul> </body> </html>"
