  body_html: <?xml version="1.0" encoding="utf-8"?> <!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Transitional//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd"> <html xmlns="http://www.w3.org/1999/xhtml" lang="en" xml:lang="en"> <head> 	<title>Untitled document</title> 	<meta http-equiv="Content-Type" content="text/html; charset=utf-8" /> </head> <body> <h1>The MPB Project&nbsp;<a href="http://www.edgesoftwareconsultancy.com/images/edgelogo.jpg"><img src="http://www.edgesoftwareconsultancy.com/index.htm" alt="The Edge Logo" title="The Edge Logo" align="right" /></a></h1><p>More than half of men are affected by male pattern baldness by age 50, and <strong>baldness treatments</strong> are estimated to be a US $1 billion per year industry.<sup class="reference"><a href="http://en.wikipedia.org/wiki/Baldness_treatments#_note-50percent">[1]</a></sup> Since the <a href="http://en.wikipedia.org/wiki/1980" title="1980">1980s</a>, drug therapy has increasingly become a realistic management option for <a href="http://en.wikipedia.org/wiki/Baldness" title="Baldness">baldness</a> for men and women. Increased understanding of the role of <a href="http://en.wikipedia.org/wiki/Dihydrotestosterone" title="Dihydrotestosterone">dihydrotestosterone</a> (DHT) in male and female pattern baldness has led to targeted intervention to prevent this hormone from acting on receptors in the scalp. Coupled with chance discoveries and the ever-present lure of a breakthrough involving stem cells and hair multiplication, scientifically proven baldness treatments continue to be an area of research that receives a large amount of funding.</p>  </body> </html>
