  updated_at: 2007-04-30 22:34:16
  body_html: <?xml version="1.0" encoding="utf-8"?> <!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Transitional//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd"> <html xmlns="http://www.w3.org/1999/xhtml" lang="en" xml:lang="en"> <head> 	<title>Untitled document</title> 	<meta http-equiv="Content-Type" content="text/html; charset=utf-8" /> </head> <body> <p>C57/bl6 mice (maximum 5 per exposure chamber) were exposed to TS generated from cigarettes (Ref. 1R1, supplied by University of Kentucky). Previous pilot studies had shown this strain of mouse to be more tolerant to TS exposure. Mice were initially exposed to 4 cigarettes on day 1 and the number of cigarettes then increased daily to a maximum of 10. Once the maximum exposure level was reached, the mice were maintained at this level throughout. The control group of mice were exposed to air for an equivalent length of time on each exposure day (Sham controls).</p>    </body> </html>
