project_contents_032: 
  name: ProjectContent-48
  updated_at: 2007-04-30 14:09:23
  body_html: <?xml version="1.0" encoding="utf-8"?> <!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Transitional//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd"> <html xmlns="http://www.w3.org/1999/xhtml" lang="en" xml:lang="en"> <head> 	<title>Untitled document</title> 	<meta http-equiv="Content-Type" content="text/html; charset=utf-8" /> </head> <body> <p><a href="http://en.wikipedia.org/wiki/Minoxidil" title="Minoxidil">Minoxidil</a> is a <a href="http://en.wikipedia.org/wiki/Vasodilator" title="Vasodilator">vasodilator</a> and originally was exclusively used as an oral drug (Loniten&reg;) to treat <a href="http://en.wikipedia.org/wiki/Hypertension" title="Hypertension">high blood pressure</a>. It was discovered, however, to have the side effect of hair growth and reversing baldness, and in the 1980&#39;s, Upjohn Corporation received FDA approval to market a topical solution that contained 2% minoxidil to be used to treat baldness and hair loss as <a href="http://en.wikipedia.org/wiki/Rogaine_%28drug%29" title="Rogaine (drug)">Rogaine</a>. Minoxidil is applied topically to the scalp, and has been shown to promote hair growth in about 25% of men and women, though it may take several months to work. New hair is usually thinner and lighter, like baby hair, and grows mostly on the top of the head, not at the hairline. Its effects may fade with time. Skin irritation is the most commonly reported side effect. Dizziness and increased heart rate are listed side-effects on the UK patient information leaflet.</p> <p>Objective evidence now shows that minoxidil is effective in frontal areas of the scalp, and not just in the vertex area in male-pattern hair loss. At the conclusion of a 48 week study, improvements were seen in the frontal scalp regions of 51 percent of men using 5 percent minoxidil, 42 percent using 2 percent minoxidil, and 13 percent of placebo users. Among these men, moderate to great increases in hair growth were seen in the frontal scalp regions of 19 percent of men using 5 percent minoxidil, 10 percent using 2 percent minoxidil, and 3 percent of placebo users. <a rel="nofollow" href="http://www.modernmedicine.com/modernmedicine/article/articleDetail.jsp;jsessionid=GqhKXbTSppGQWLhLDmk2hbrYXGYyQD0NzWRCLBvVQLQL8YbGr8LK%212026812983?id=51115" title="http://www.modernmedicine.com/modernmedicine/article/articleDetail.jsp;jsessionid=GqhKXbTSppGQWLhLDmk2hbrYXGYyQD0NzWRCLBvVQLQL8YbGr8LK!2026812983?id=51115" class="external autonumber">[1]</a></p> </body> </html>
