project_contents_021: 
  name: ProjectContent-27
  updated_at: 2007-04-25 21:23:28
  body_html: <?xml version="1.0" encoding="utf-8"?> <!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Transitional//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd"> <html xmlns="http://www.w3.org/1999/xhtml" lang="en" xml:lang="en"> <head> 	<title>Untitled document</title> 	<meta http-equiv="Content-Type" content="text/html; charset=utf-8" /> </head> <body> <font face="Verdana, Arial, Helvetica" size="2"><font face="Verdana,Arial,Helvetica" size="2">he HRP2 drug sensitivity assay is based on the measurement of the increase in HRP2 concentrations in <em>P. falciparum</em> culture samples. HRP2 is being produced in the course of parasite growth and propagation and may easily be measured in a simple ELISA. If parasite growth is inhibited by antmalarial drugs, the inhibition is reflected in HRP2 levels and may therefore easily be quantified.<br /><br /> The culture procedures are similar to other drug sensitivity assays (e.g. isotopic assay), except that the HRP2 assay is very sensitive and therefore requires only low parasite densities. The HRP2 concentrations are determined with a commercial ELISA test kit (Malaria Ag CELISA, Cellabs Pty. Ltd., Brookvale, NSW, Australia; http://www.cellabs.com.au) which takes only about 2.5 hours to perform.<br /><br /> In a first evaluation with culture adapted parasite strains, the assay proved to be sensitive, simple to establish and highly reproducible. It may be carried out with commercial test kits and requires relatively little technical equipment. In correlation analysis (and to a lower extent in Bland-Altman plots) the results closely paralleled those obtained from the isotopic assay (R = 0.892; P &lt; 0.0001) and from a modified WHO schizont maturation test (R = 0.959; P &lt; 0.0001). It may therefore be used for a wide range of applications from epidemiological studies to the screening of new drugs, and may have the potential to replace traditional <em>in vitro</em> techniques, such as the isotopic assay.</font></font> </body> </html>
