project_contents_055: 
  name: ProjectContent-73
  updated_at: 2007-04-30 22:34:33
  body_html: "<?xml version=\"1.0\" encoding=\"utf-8\"?> <!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\" \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\"> <html xmlns=\"http://www.w3.org/1999/xhtml\" lang=\"en\" xml:lang=\"en\"> <head> \t<title>Untitled document</title> \t<meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\" /> </head> <body> <p>Animals were killed by anaesthetic overdose (pentobarbitone Na, 100mg/kg i.p.) as follows:-</p><p>Groups E (Sham) and F (TS) were sacrificed on day 11, 6 hrs post the 11th and final exposure and groups A (Sham), B (TS), C (Bay 19-8004) and D (Dexamethasone) on day 12, 24 h post the 11th and final exposure.</p><p>Mice from each treatment group were treated as follows: - blood samples were taken from the sub clavian artery into EDTA syringes for plasma. Bronchoalveolar lavage (BAL) was performed using 0.4ml of heparinised phosphate buffered saline (PBS). Cells recovered from the BAL were used for total and differential cell counts. BAL supernatants were then stored at -40&deg;C prior to subsequent analysis.&nbsp; Following lavage, the right lobes were placed in RNAlater and stored at -80&deg;C. The left lobes were placed in 10% PBF.</p>  </body> </html>"
