  body_html: <?xml version="1.0" encoding="utf-8"?> <!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Transitional//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd"> <html xmlns="http://www.w3.org/1999/xhtml" lang="en" xml:lang="en"> <head> 	<title>Untitled document</title> 	<meta http-equiv="Content-Type" content="text/html; charset=utf-8" /> </head> <body>  		     		 		                                                                    <font size="2">         <!-- S BO --> <!-- S IIMA --> 	 		<table border="0" cellspacing="0" cellpadding="0" width="203" align="right"> 			<tbody><tr><td> 			<div> 				<img src="http://newsimg.bbc.co.uk/media/images/39889000/jpg/_39889982_bald203.jpg" border="0" alt="" hspace="0" vspace="0" width="203" height="152" /> 				<div class="cap">The discovery could lead to new treatments for baldness</div> 			</div> 			</td></tr> 		</tbody></table> 		 	  	 <!-- E IIMA -->  	 <strong> Scientists believe they may have found a new way to reverse baldness and treat conditions like alopecia.  </strong> </font><p> <font size="2">Researchers from the University of Pennsylvania have identified stem cells or master cells in the hair follicles of mice.  </font></p><p> <font size="2">They found that these cells grow into hair follicles and produce hair when transplanted into skin.  </font></p><p> <font size="2">Writing in Nature Biotechnology, they said the discovery could lead to new treatments for humans.   </font></p><p> <font size="2"><strong>Key genes</strong> </font></p><p> <font size="2">The researchers found certain genes were activated in the stem cells that were not activated in other hair follicle or skin cells. </font></p><p> <font size="2">They are now planning further research to identify these genes in humans.  </font></p><p>    <font size="2">         <!-- S IBOX --> 	<table border="0" cellspacing="0" cellpadding="0" width="208" align="right"> 	<tbody><tr>             <td width="5"><img src="http://newsimg.bbc.co.uk/shared/img/o.gif" border="0" alt="" hspace="0" vspace="0" width="5" height="1" /></td>             <td class="sibtbg">                  		                                                            <div> 	<div class="mva"> 		<img src="http://newsimg.bbc.co.uk/nol/shared/img/v3/start_quote_rb.gif" border="0" alt="" width="24" height="13" /> 		<strong> 	These findings provide potential targets for the treatment of hair loss   </strong> 		<img src="http://newsimg.bbc.co.uk/nol/shared/img/v3/end_quote_rb.gif" border="0" alt="" vspace="0" width="23" height="13" align="right" /><br />	</div>     </div>                                                            <div class="mva"> 	<div> 	Researchers,<br />University of Pennsylvania   </div>   </div>                              </td>         </tr> 	</tbody></table> 	     <!-- E IBOX -->          	 They said developing drugs to affect these genes could lead to new ways of controlling hair growth.  </font></p><p> <font size="2">&quot;By defining these molecular markers, we will be able to isolate human stem cells from hair follicles,&quot; Dr George Cotsarelis, one of those involved in the study, told Reuters. </font></p><p> <font size="2">While the discovery could lead to new treatments for baldness and conditions like alopecia, the researchers believe it may also help burn victims. </font></p><p> <font size="2">&quot;One problem with a burn is that the wound is never covered with hair follicles,&quot; said Dr Cotsarelis.  </font></p><p> <font size="2">&quot;These cells have that capability so if we can isolate them and seed them onto a wound we can constitute skin that is more normal than currently possible.&quot; </font></p><p> <font size="2">Scientists have long-suspected that hair follicles contained stem cells. However, it has proved difficult to isolate these cells in humans. </font></p><p> <font size="2">This latest study raises hopes that they can now track these genes and identify stem cells in human hair follicles.  </font></p><p> <font size="2">&quot;Ultimately, these findings provide potential targets for the treatment of hair loss and other disorders of skin and hair,&quot; the researchers wrote. </font></p> </body> </html>
