project_contents_033: 
  name: ProjectContent-49
  updated_at: 2007-04-30 14:10:06
  body_html: "<?xml version=\"1.0\" encoding=\"utf-8\"?> <!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\" \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\"> <html xmlns=\"http://www.w3.org/1999/xhtml\" lang=\"en\" xml:lang=\"en\"> <head> \t<title>Untitled document</title> \t<meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\" /> </head> <body> <a href=\"http://en.wikipedia.org/wiki/Finasteride\" title=\"Finasteride\">Finasteride</a>, marketed as the brand-name drug <em><a href=\"http://en.wikipedia.org/wiki/Propecia\" title=\"Propecia\">Propecia</a></em>, belongs to a class of drugs called aza-steroids. It is a &quot;<a href=\"http://en.wikipedia.org/wiki/Dihydrotestosterone\" title=\"Dihydrotestosterone\">DHT</a> <a href=\"http://en.wikipedia.org/wiki/Enzyme_inhibitor\" title=\"Enzyme inhibitor\">inhibitor</a>&quot; that is FDA approved to inhibit production of DHT through the entire body. It accomplishes this by blocking the production of <a href=\"http://en.wikipedia.org/wiki/5-alpha-reductase\" title=\"5-alpha-reductase\">5-alpha-reductase</a>, the enzyme responsible for the conversion of free testosterone to DHT. Finasteride is taken orally and has a reported 29-68% success rate (vs. 17-45% in patients receiving a <a href=\"http://en.wikipedia.org/wiki/Placebo\" title=\"Placebo\">placebo</a>). It is effective only for as long as it is taken; the hair gained or maintained is lost within 6-12 months of ceasing therapy (Rossi, 2004). In clinical studies, finasteride, like minoxodil, was shown to work on both the crown area and the hairline,<sup class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/Baldness_treatments#_note-finasteride1\">[2]</a></sup> but is most successful in the crown area. <p>Finasteride has been shown to be ineffective for treating hair loss in women, and should not even be touched by pregnant or potentially pregnant women, as it has been speculated that it could cause severe birth defects in male fetuses.<sup class=\"noprint Template-Fact\"><a href=\"http://en.wikipedia.org/wiki/Wikipedia:Citing_sources\" title=\"Wikipedia:Citing sources\"><span style=\"white-space: nowrap\">[<em>citation needed</em>]</span></a></sup> However, finasteride&#39;s supporters respond that the study was on post-menopausal women whose hairloss was more likely related to the loss of estrogen versus a sensitivity to testosterone. Other studies<sup class=\"noprint Template-Fact\"><a href=\"http://en.wikipedia.org/wiki/Wikipedia:Citing_sources\" title=\"Wikipedia:Citing sources\"><span style=\"white-space: nowrap\">[<em>citation needed</em>]</span></a></sup> have shown that finasteride is effective for many women with follicular sensitivity to androgens. Many doctors do prescribe it, but not without either careful birth control measures or assurance that the woman cannot become pregnant.</p> <p>Recently, Glaxo Wellcome released another aza-steroid called <a href=\"http://en.wikipedia.org/wiki/Dutasteride\" title=\"Dutasteride\">dutasteride</a> and marketed as &quot;Avodart&quot;, also for BPH. While hair count studies showed that 2.5 mg of dutasteride was about 1.5 times as effective as finasteride for hair regrowth (adding on average 108 versus 72 hair per 1&quot; diameter area), Glaxo stopped FDA hair loss studies after phase II. While the exact reason was never made public, it was leaked that the product was too similar to finasteride, which itself had not lived up to expectations commercially. As such, the 2.5 mg dosage was not released. The FDA trials for BPH continued, and Avodart became the first drug shown to shrink an enlarged prostate in a clinical study. The .5mg version of the drug (shown in the same study to add on average 92 hair to the same area) is increasingly available to hair loss sufferers via the grey-market of online prescription medication, and physicians increasingly willing to prescribe drugs &quot;off-label.&quot;</p> <p>In December 2006, <a href=\"http://en.wikipedia.org/wiki/GlaxoSmithKlein\" title=\"GlaxoSmithKlein\">GlaxoSmithKlein</a> embarked on a new Phase III, six month study in Korea to test the safety, tolerability and effectiveness of a once-daily dose of <a href=\"http://en.wikipedia.org/wiki/Dutasteride\" title=\"Dutasteride\">dutasteride</a> (0.5mg) for the treatment of <a href=\"http://en.wikipedia.org/wiki/Male_pattern_baldness\" title=\"Male pattern baldness\">male pattern baldness</a> in the vertex region of the scalp (types IIIv, IV and V on the <a href=\"http://en.wikipedia.org/wiki/Hamilton-Norwood_scale\" title=\"Hamilton-Norwood scale\">Hamilton-Norwood scale</a>). <a rel=\"nofollow\" href=\"http://clinicaltrials.gov/show/NCT00441116\" title=\"http://clinicaltrials.gov/show/NCT00441116\" class=\"external autonumber\">[2]</a> The future impact that this study will have on the <a href=\"http://en.wikipedia.org/wiki/FDA\" title=\"FDA\">FDA</a>&#39;s approval or disapproval of <a href=\"http://en.wikipedia.org/wiki/Avodart\" title=\"Avodart\">Avodart</a> for the treatment of <a href=\"http://en.wikipedia.org/wiki/Male_pattern_baldness\" title=\"Male pattern baldness\">male pattern baldness</a> in the United States is yet to be determined.</p> </body> </html>"
