  body_html: <?xml version="1.0" encoding="utf-8"?> <!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Transitional//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd"> <html xmlns="http://www.w3.org/1999/xhtml" lang="en" xml:lang="en"> <head> 	<title>Untitled document</title> 	<meta http-equiv="Content-Type" content="text/html; charset=utf-8" /> </head> <body> <p><font face="Verdana, Arial, Helvetica, sans-serif" size="2">Bradykinin                          stimulates further synthesis/release of prostaglandins,                          and, together with the prostaglandins, sensitizes the                          primary afferent sensory fibers in response to stimulation                          by ATP, acetylcholine, serotonin and mechanical and thermal                          stimuli <font size="-2">1,2,3</font></font></p><p><font face="Verdana, Arial, Helvetica, sans-serif" size="2">Substance                          P and CGRP released by the primary afferent sensory fibers                          contribute to the pain response by triggering the release                          of histamine from mast cells which, in turn, excites the                          peripheral afferent sensory fibers <font size="-2">1,2,3</font></font></p><p><font face="Verdana, Arial, Helvetica, sans-serif" size="2">&quot;                          Sensitization of the primary afferent sensory fibers by                          mediators of the pain response results in greater, more                          frequent transmission of action potentials to the nociceptive                          neurons than in &#39;normal&#39; pain responses <font size="-2">1,2,5                          </font></font></p> </body> </html>
